import React from 'react'
import initial from './Datas'
export default function Q3() {
  return (
<div>
{initial.map((c,i)=>{
    return <div key={i} className='col-4'>
      <div className="card" >
      <img src={c.avatar} className="card-img-top" id='imgCvr' alt="image1"/>
    <div className="card-body">
     <h5 className="card-title">
        {c.name}
     </h5>
     <p className="card-text">
        {c.SurfaceArea}
      </p>
        {c.map((p,i)=>{
            return <p key={i}> 
            {p.Population}
            </p>
        })}
    </div>
    </div>
    </div>
})}
   
</div>
    
  )
}
